import React from 'react';
import Todo from './components/Todo';
import { ConfigProvider } from 'antd';
import './App.css';

function App() {
  <ConfigProvider
    theme={{
      token: {
        // Seed Token
        colorPrimary: '#00b96b',
        borderRadius: 2,

        // Alias Token
        colorBgContainer: '#f6ffed',
      },
    }}
  ></ConfigProvider>
  return (
    <div className="App">
      <Todo />
    </div>
  );
}

export default App;
